import{_ as r,o as n,c as s,b as t,d,a,e,r as o}from"./app.5ed19468.js";var l="/aktivitaeten/BDM-2024-06/00_06-2024.jpg",m="/aktivitaeten/BDM-2024-06/01_06-2024.jpg",g="/aktivitaeten/BDM-2024-06/02_06-2024.jpg",p="/aktivitaeten/BDM-2024-06/03_06-2024.jpg",c="/aktivitaeten/BDM-2024-06/04_06-2024.jpg",_="/aktivitaeten/BDM-2024-06/05_06-2024.jpg",h="/aktivitaeten/BDM-2024-06/06_06-2024.jpg",u="/aktivitaeten/BDM-2024-06/07_06-2024.jpg",v="/aktivitaeten/BDM-2024-06/08_06-2024.jpg",B="/aktivitaeten/BDM-2024-06/09_06-2024.jpg",M="/aktivitaeten/BDM-2024-06/10_06-2024.jpg",k="/aktivitaeten/BDM-2024-06/11_06-2024.jpg",D="/aktivitaeten/BDM-2024-06/12_06-2024.jpg",f="/aktivitaeten/BDM-2024-06/13_06-2024.jpg",j="/aktivitaeten/BDM-2024-06/14_06-2024.jpg",b="/aktivitaeten/BDM-2024-06/15_06-2024.jpg",S="/aktivitaeten/BDM-2024-06/16_06-2024.jpg",w="/aktivitaeten/BDM-2024-06/17_06-2024.jpg",A="/aktivitaeten/BDM-2024-06/18_06-2024.jpg",z="/aktivitaeten/BDM-2024-06/20_06-2024.jpg",T="/aktivitaeten/BDM-2024-06/21_06-2024.jpg",E="/aktivitaeten/BDM-2024-06/22_06-2024.jpg",C="/aktivitaeten/BDM-2024-06/23_06-2024.jpg",N="/aktivitaeten/BDM-2024-06/24_06-2024.jpg",H="/aktivitaeten/BDM-2024-06/25_06-2024.jpg",P="/aktivitaeten/BDM-2024-06/26_06-2024.jpg",R="/aktivitaeten/BDM-2024-06/27_06-2024.jpg",U="/aktivitaeten/BDM-2024-06/28_06-2024.jpg",V="/aktivitaeten/BDM-2024-06/29_06-2024.jpg",F="/aktivitaeten/BDM-2024-06/30_06-2024.jpg",O="/aktivitaeten/BDM-2024-06/31_06-2024.jpg",W="/aktivitaeten/BDM-2024-06/32_06-2024.jpg",L="/aktivitaeten/BDM-2024-06/33_06-2024.jpg",Q="/aktivitaeten/BDM-2024-06/34_06-2024.jpg",x="/aktivitaeten/BDM-2024-06/35_06-2024.jpg",J="/aktivitaeten/BDM-2024-06/36_06-2024.jpg",I="/aktivitaeten/BDM-2024-06/37_06-2024.jpg",K="/aktivitaeten/BDM-2024-06/38_06-2024.jpg";const G={},Z=a('<h1 id="bilder-des-monats-juni-2024" tabindex="-1"><a class="header-anchor" href="#bilder-des-monats-juni-2024" aria-hidden="true">#</a> Bilder des Monats Juni 2024</h1><p>DF9HC beim (erfolgreichen) Versuch 5 Parks an einem Tag zu aktivieren. 3fer DE-0291/0300/0604 und 2fer DE-0550/0622. Conds waren ziemlich schlecht aber am Ende hat es gereicht.</p><p><img src="'+l+'" alt="Bilder des Monats"><img src="'+m+'" alt="Bilder des Monats"><img src="'+g+'" alt="Bilder des Monats"><img src="'+p+'" alt="Bilder des Monats"></p><p>Im D\xE4nemarkurlaub hat sich OZ/DL6PL an der Erstaktivierung von DK-0105, R\xF8jle Klint Coastal Park, versucht. Der Aussichtspunkt des Parks erwies sich als ungeeignet, da ein naher Weidezaun QRM in der H\xF6he von 9 S-Stufen produziert hat. Ein Standortwechsel an den Strand sorgte dann aber f\xFCr einen verh\xE4ltnism\xE4\xDFig st\xF6rungsarmen Betrieb. Nach recht z\xE4hem Rufen auf 20 m gingen die erhofften 10 QSOs dank der \xFCblichen Verd\xE4chtigen ins Log. Nach einem Ausflug auf 17 m konnte er auf 15 m u.a. noch Japan und die USA arbeiten.</p><p><img src="'+c+'" alt="Bilder des Monats"><img src="'+_+'" alt="Bilder des Monats"></p>',5),q=e("DC1TC hat sich an die Erstaktivierung von "),y={href:"https://pota.app/#/park/DE-0719",target:"_blank",rel:"noopener noreferrer"},X=e("DE-0719"),Y=e(" NSG Duvenstedter Brook gewagt. Nachdem auf einem der Hauptwege keine gute Stelle zu finden war, wurde auf einem kleineren Wanderweg die Abzweigung zu einem aktuell gesperrten Weg, zu einem guten Aktivierungspunkt ohne offizielle Wege verlassen zu m\xFCssen. Mit 17 QSOs auf 20 und 40m und mehreren Drau\xDFenfunker2Drau\xDFenfunker-Verbindungen war es ein Erfolg. Da das M\xFCckenspray vergessen wurde, gab zus\xE4tzlich etwa gleich viele Stiche wie QSOs als Souvenir mit nach Hause."),$=a('<p><img src="'+h+'" alt="Bilder des Monats"><img src="'+u+'" alt="Bilder des Monats"></p><p>Do6BMH hat sein altes Stativ f\xFCr den qrp Betrieb fertig gemacht</p><p><img src="'+v+'" alt="Bilder des Monats"></p><p>Was f\xFCr ein erfolgreicher Tag mit meinem FT 891! Heute habe ich es richtig kennengelernt bei 23 QSOs von 10 - 16 UTC ( mit Pausen dazwischen )</p><p>Verbraucht habe ich dabei 4.315 Ah und 55.3 Wh bei 12.9 Volt Restspannung. Ich habe nur SOTA und POTA gehunted: 15 POTA und 5 Summits on the Air. Die anderen 3 waren zwischendrin, als nichts los war.</p><p>Von der Ukraine, Deutschland, Spanien, England, Schottland, T\xFCrkei, Schweden, Rum\xE4nien, Italien, Bulgarien, Frankreich war alles dabei, mit der EFHW-Antenne 49:1 aufgedrillt mit 10 m Draht an einem 7 m Spiderbeam Mast f\xFCr das 20 Meter Band.</p><p>73 44 DL2MBN</p><p><img src="'+B+'" alt="Bilder des Monats"><img src="'+M+'" alt="Bilder des Monats"><img src="'+k+'" alt="Bilder des Monats"><img src="'+D+'" alt="Bilder des Monats"><img src="'+f+'" alt="Bilder des Monats"><img src="'+j+'" alt="Bilder des Monats"></p><p>Aktivierung von HU-0016, leider nur wenig Zeit, musste fertig sein, bis meine Freundin von ihrer Runde zur\xFCck ist.</p><p><img src="'+b+'" alt="Bilder des Monats"></p><p>Als W6/DC1TC habe ich meine fehlgeschlagene Aktivierung von US-3566 Seacliff State Beach vom letzten Jahr korrigiert. Diesmal habe ich direkt am Strand anstatt auf den Klippen aufgebaut (wo ich letztes Jahr sehr starkes QRM hatte). Auch unten hatte ich noch recht starkes QRM, es hat sich \xFCber die Zeit aber ver\xE4ndert. Mit dem im FT-891 eingebauten NB und DNR habe ich die St\xF6rungen ausreichend in den Griff bekommen k\xF6nnen um 25 QSOs zu machen, davon 10 P2P. Ich hatte mir erst Sorgen gemacht, dass ich durch die Klippen nicht ins Landesinnere komme, das ging aber doch relativ gut.</p><p><img src="'+S+'" alt="Bilder des Monats"><img src="'+w+'" alt="Bilder des Monats"><img src="'+A+'" alt="Bilder des Monats"></p><p>Folgende weitere Aktivierungen habe ich als W6/DC1TC in Kalifornien durchgef\xFChrt: Am 24.06. US-1145 Donner Memorial State Park als 2-fer mit US-4469 Tahoe National Forest. Am 26.06. US-0049 Lassen Volcanic National Park. Am 27.06. US-0647 Golden Gate Recreation Area. Jeder Ort kam mit seinen eigenen Herausforderungen, durch den UTC-Tageswechsel w\xE4hrend Aktivierungen habe ich leider einige \u201EFehlschl\xE4ge\u201C in der Statistik, die aber jeweils in der n\xE4chsten Stunden am n\xE4chsten UTC-Tag ausgeglichen wurden.</p><p><img src="'+z+'" alt="Bilder des Monats"><img src="'+T+'" alt="Bilder des Monats"><img src="'+E+'" alt="Bilder des Monats"><img src="'+C+'" alt="Bilder des Monats"><img src="'+N+'" alt="Bilder des Monats"><img src="'+H+'" alt="Bilder des Monats"></p><p>Draussenfunken kombiniert mit anderen Hobbies. Hier z.B. mit Angeln auf dem Waginger und Tachinger See (DE-0319 &amp; DE-0318)</p><p><img src="'+P+'" alt="Bilder des Monats"><img src="'+R+'" alt="Bilder des Monats"><img src="'+U+'" alt="Bilder des Monats"><img src="'+V+'" alt="Bilder des Monats"><img src="'+F+'" alt="Bilder des Monats"><img src="'+O+'" alt="Bilder des Monats"><img src="'+W+'" alt="Bilder des Monats"></p><p>Parks on the Air Aktivierung vom Seewald DE-0766 in Friedrichshafen nach dem Ham Radio Besuch.</p><p><img src="'+L+'" alt="Bilder des Monats"><img src="'+Q+'" alt="Bilder des Monats"><img src="'+x+'" alt="Bilder des Monats"><img src="'+J+'" alt="Bilder des Monats"><img src="'+I+'" alt="Bilder des Monats"><img src="'+K+'" alt="Bilder des Monats"></p>',18);function ee(te,ae){const i=o("ExternalLinkIcon");return n(),s("div",null,[Z,t("p",null,[q,t("a",y,[X,d(i)]),Y]),$])}var re=r(G,[["render",ee],["__file","2024-06-30-Bilder-Des-Monats-Juni.html.vue"]]);export{re as default};
